import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Employees = () => {
  const [employees, setEmployees] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/employees/')
      .then(res => setEmployees(res.data))
      .catch(err => console.error('API Error:', err));
  }, []);

  return (
    <div className="ml-64 p-6">
      <h2 className="text-2xl font-semibold mb-4">Employee Directory</h2>
      <table className="min-w-full bg-white border">
        <thead>
          <tr className="bg-gray-200 text-left">
            <th className="py-2 px-4 border">ID</th>
            <th className="py-2 px-4 border">Name</th>
            <th className="py-2 px-4 border">Department</th>
            <th className="py-2 px-4 border">Position</th>
          </tr>
        </thead>
        <tbody>
          {employees.map(emp => (
            <tr key={emp.id}>
              <td className="py-2 px-4 border">{emp.id}</td>
              <td className="py-2 px-4 border">{emp.name}</td>
              <td className="py-2 px-4 border">{emp.department}</td>
              <td className="py-2 px-4 border">{emp.position}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Employees;
